import Header from './Components/Header.jsx';
import {Container} from 'react-bootstrap';
import AutoScreen from './Screens/AutoScreen';
import HomeScreen from './Screens/HomeScreen';

function App(){
  return(
    <div>
      <Header/>
      <Container>
        <HomeScreen />
        <AutoScreen />
      </Container>
    </div>
  )
}

export default App;
